package speech;

import java.io.BufferedReader;
import java.io.DataOutputStream;
import java.io.InputStream;
import java.io.InputStreamReader;
import java.net.HttpURLConnection;
import java.net.URL;

import org.apache.log4j.Logger;

import net.sf.json.JSONArray;
import net.sf.json.JSONObject;
/**
 * 
 * @className: Sample   音频转文字
 * @description: TODO 
 * @since  2015-5-20	下午03:33:36
 * @author 杨伟中 yangweizhong_uzoo_cn
 */
public class SpeechToText {
	private static Logger logger = Logger.getLogger(SpeechToText.class);
    private static final String serverURL = "http://vop.baidu.com/server_api";
    private static String       token     = "";
    private static final String cuid      = "5965645";
    
    public static void main(String[] args) {
		String speech = "";
		long len = 55296;
		int rate = 16000;
		String format = "wav";
		
		System.out.print(getSpeechToTextResult(speech, len,rate,format));
	}
    
    /**
     * 获取音频转文字的结果
     * @param speech
     * @param len
     * @param rate
     * @param format
     * @return
     * @throws Exception
     */
    public static String getSpeechToTextResult(String speech, long len, int rate, String format) {
    	try{
        token = RestApiToken.getToken();
        logger.info(speech);
        logger.info(len);
        logger.info(rate);
        logger.info(format);
        return method1(speech, len, rate, format);
    	}catch(Exception e){
    		e.printStackTrace();
    		return "";
    	}
    }
    /**
     * 
     * @Title: method1   
     * @Description: 音频转化为文字   
     * @param speech 音频文件
     * @param len 文件的长度
     * @return 返回音频内容对应的文字
     * @throws Exception
     */
    private static String method1(String speech, Long len, int rate, String format) throws Exception {
        HttpURLConnection conn = (HttpURLConnection) new URL(serverURL).openConnection();

        // construct params
        JSONObject params = new JSONObject();
        params.put("format", format);
        params.put("rate", rate);
        params.put("channel", "1");
        params.put("token", token);
        params.put("cuid", cuid);
        params.put("len", len);
        params.put("speech", speech);

        // add request header
        conn.setRequestMethod("POST");
        conn.setRequestProperty("Content-Type", "application/json; charset=utf-8");

        conn.setDoInput(true);
        conn.setDoOutput(true);
        //发送请求
        DataOutputStream wr = new DataOutputStream(conn.getOutputStream());
        wr.writeBytes(params.toString());
        wr.flush();
        wr.close();
        // 获取返回结果并返回解析结果
        String result = printResponse(conn);
        logger.info(result);
        JSONObject json = JSONObject.fromObject(result);
        JSONArray ja = json.getJSONArray("result");
        if(!ja.isEmpty()){
        	return ja.getString(0);
        }else {
            return result;
        }
    }
    /*
     * 获取返回的相应结果
     */
    private static String printResponse(HttpURLConnection conn) throws Exception {
        if (conn.getResponseCode() != 200) {
            // request error
            return "";
        }
        InputStream is = conn.getInputStream();
        BufferedReader rd = new BufferedReader(new InputStreamReader(is));
        String line;
        StringBuffer response = new StringBuffer();
        while ((line = rd.readLine()) != null) {
            response.append(line);
            response.append('\r');
        }
        rd.close();
        return response.toString();
    }
   
}
